import '../style/TodoObject.css';

import staron from '../asset/icon/free-icon-favorite-121726.png';
import staroff from '../asset/icon/free-icon-favorite-121724.png';

import check from '../asset/icon/free-icon-checkbox-1287087.png';
import uncheck from '../asset/icon/free-icon-checkbox-7891407.png';

const TodoObject = ({ todo, onRemove, onCheck, onImportant }) => {
    const { id, text, checked, star } = todo;

    return (
        <div className='todolist-listobject'>

            <div className='' onClick={() => onCheck(id)}>

                {checked ? 
                    <img className='todolist-listobjectimg' src={check} alt='!!'/> 
                : 
                    <img className='todolist-listobjectimg' src={uncheck} alt='!!'/>
                }

                <div className="text">
                    {text}
                </div>

            </div>

            <div className='' onClick={() => onImportant(id)}>
            별
            </div>

            <div className="remove" onClick={() => onRemove(id)}>
            삭제
            </div>

        </div>
    )
}

export default TodoObject;
